let previous_words = []

function set_message(new_message) {
    document.getElementById("message").innerHTML = new_message
    //console.log(new_message)
}

function accept_new_word(word) {
    previous_words.push(word)
    document.getElementById("history").innerHTML += "<li>" + word + "</li>"
    document.getElementById("new_word").value = ""
    set_message('Rendben van, ' + word + ' hozzafuzve a listahoz.')
}

function is_compatible(word1, word2) {
    return word1[word1.length - 1] == word2[0]
}

function was_already(word) {
    return previous_words.indexOf(word) != -1
}

function button_click() {
    let new_word = document.getElementById("new_word").value

    if (previous_words.length == 0) accept_new_word(new_word)
    else {
        let previous_word = previous_words[previous_words.length - 1]
        if (word_list.indexOf(new_word) == -1) {
            set_message('Nem ertelmes magyar szo')
        } else if (was_already(new_word)) {
            set_message('Ez mar volt.')
        } else if (!is_compatible(previous_word, new_word)) {
            set_message('Nem megfelelo szo.')
        } else {
            accept_new_word(new_word)
        }
    }
}

